import React from 'react';

const Todo = props => {
  const { id, toggleComplete, todo, completed } = props;
  return (
    <li>
    {todo}
    style={completed ? { textDecoration: 'line-through' } : null}
    onClick={() => toggleComplete(id)}

  </li>
  );
};

export default Todo;
